import React from 'react';

const BackgroundHeader = () => {

    return (
        <div className="background-header" >
            <div className="header-intro" >
                <h1>ALWAYS FOR YOU</h1>
                <h2>CLOSE THAN EVER</h2>
            </div>
        </div>
    )

}

export default BackgroundHeader;
